import logo from './logo.svg';
import './App.css';
import { ItemService } from './services/TaskService';

export default class App extends Component{
  constructor(){
    super();
    this.setState({
      tasks: []
    });
    this.ItemSevice = new ItemService();
  }

  componentDidMount(){
    this.ItemSevice.getAll().then(data => {
      console.log(data);
    })
  }

  render(){
    <h1>Holaworld</h1>
  }
}
